BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `students` (
	`name`	TEXT,
	`surnames`	TEXT,
	`email`	TEXT,
	`country`	TEXT,
	`s_pk`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`c_pk`	INTEGER
);
CREATE TABLE IF NOT EXISTS `passengers` (
	`PassengerId`	INTEGER,
	`Survived`	INTEGER,
	`Pclass`	INTEGER,
	`Name`	TEXT,
	`Sex`	TEXT,
	`Age`	NUMERIC,
	`SibSp`	INTEGER,
	`Parch`	INTEGER,
	`Ticket`	TEXT,
	`Fare`	REAL,
	`Cabin`	TEXT,
	`Embarked`	TEXT
);
CREATE TABLE IF NOT EXISTS `courses` (
	`c_pk`	INTEGER,
	`title`	TEXT,
	PRIMARY KEY(`c_pk`)
);
CREATE TABLE IF NOT EXISTS `3_bike_sharing` (
	`datetime`	TEXT,
	`season`	NUMERIC,
	`holiday`	NUMERIC,
	`workingday`	NUMERIC,
	`weather`	NUMERIC,
	`temp`	REAL,
	`atemp`	REAL,
	`humidity`	REAL,
	`windspeed`	REAL,
	`casual`	INTEGER,
	`registered`	INTEGER,
	`count`	INTEGER
);
COMMIT;
